INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501043, "この蝋燭は、もしや君が作ったのか？\nなに、精油にそんな希少な成分を？\nわざわざぼくの誕生日を祝うために？\n後輩……君という子は……！", 0, 4, 1110501, 0, 1, 1, "", 111011, 11);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501044, "", "", "", 1110501, "", "", "", "", 0, 91);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501045, "vo_adv_1110501_002", "", 0, 1110501, "", 0, "", "", "vo_adv_1110501", 21);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501046, "しかし蝋燭はいいが、この土台部分──\nいや、バースデーケーキとかいう祝祭の\n文化か。ううむ気持ちは有難いが、\n食の細いぼくには若干拷問サイズだ……", 0, 4, 1110501, 0, 1, 1, "", 111011, 11);
INSERT INTO `v1_689c12ebf46bbff98fa95b9931d480818cc6fcf1639863aa105b98f9bddfe0c0` VALUES (1110501047, "", "", "", 1110501, "", "", "", "", 0, 91);
